			fieldNo = i
			break
		end
	end
	for k, v in pairs(Star) do
		if v[fieldNo] == fieldValue then
			setmetatable (v, mt)
			arrData[#arrData+1] = v
		end
	end

	return arrData
end

function release()
	_G["DB_Star"] = nil
	package.loaded["DB_Star"] = nil
	package.loaded["db/DB_Star"] = nil
end

